import {Link} from 'react-router-dom';
const Navbar=()=> {
<nav>
    <Link to='/mypages'> HOME </Link>
    <Link to='/mypages/about'> ABOUT </Link>
    <Link to='/mypages/product'> PRODUCT </Link>
</nav>
}

export default Navbar;
